import { Grid } from '@material-ui/core';
import React from 'react'
import NavigationBar from '../components/NavigationBar.js';
import '../styles/Home.css';
import Footer from '../components/Footer.js';
import { makeStyles } from '@material-ui/core/styles';
import E_Board from '../components/Team/E_board';
import Director from '../components/Team/Director';
import VP from '../components/Team/VP';
import Tech_Team from '../components/Team/Tech_Team';
import Section_Head from '../components/Team/Section_Head.js';
import Team_Section from '../components/Team/Team_Section.js';
import Ambassador from '../components/Team/Ambassadors.js';

import PropTypes from 'prop-types';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import CssBaseline from '@material-ui/core/CssBaseline';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles({
    root: {
    },
    head1: {
        background: '#fc9fb6',
        color: 'rgb(255, 255, 255)',
        marginBottom: '20px',
        paddingTop: '40px',
        paddingBottom: '40px',
        paddingLeft: '10%',
        paddingRight: '10%',
        "@media (max-width: 600px)": {
            paddingTop: '20px',
            paddingBottom: '20px',
        } 
    },
    head2: {
        background: 'rgb(173, 98, 117)',
        color: 'rgb(255, 255, 255)',
        marginBottom: '60px',
        marginTop: '80px',
        paddingTop: '40px',
        paddingBottom: '40px',
        paddingLeft: '10%',
        paddingRight: '10%',
        "@media (max-width: 600px)": {
            paddingTop: '20px',
            paddingBottom: '20px',
        } 
    },
    head3: {
        background:  'rgb(181, 196, 255);',
        color: 'rgb(255, 255, 255)',
        marginBottom: '60px',
        marginTop: '80px',
        paddingTop: '30px',
        paddingBottom: '30px',
        paddingLeft: '10%',
        paddingRight: '10%',
        "@media (max-width: 600px)": {
            paddingTop: '20px',
            paddingBottom: '20px',
        } 
    },
});

function ElevationScroll(props) {
    const { children, window } = props;
    // Note that you normally won't need to set the window ref as useScrollTrigger
    // will default to window.
    // This is only being set here because the demo is in an iframe.
    const trigger = useScrollTrigger({
      disableHysteresis: true,
      threshold: 0,
      target: window ? window() : undefined,
    });
  
    return React.cloneElement(children, {
      elevation: trigger ? 4 : 0,
    });
  }
  
  ElevationScroll.propTypes = {
    children: PropTypes.element.isRequired,
    /**
     * Injected by the documentation to work in an iframe.
     * You won't need it on your project.
     */
    window: PropTypes.func,
  };

function Team(props) {
    const classes=useStyles();
    return (
        <Grid container direction="column" className={classes.root}>
            <Grid item>
            <ElevationScroll {...props}>
                <NavigationBar/>
                </ElevationScroll>
            </Grid>
            <Grid item className={classes.head1}>
                <Team_Section title="Executive Board"/>
            </Grid>
            <Grid item>
                <Section_Head title="Co-Founders/Co-Presidents"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <E_Board />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item>
                <Section_Head title="Directors"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <Director />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item>
                <Section_Head title="Vice Presidents"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <VP />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item className={classes.head2}>
                <Team_Section title="Tech-Team"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <Tech_Team />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item className={classes.head3}>
                <Team_Section title="Ambassadors"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} />
                <Grid item xs={10} sm={10} align="center">
                    <Ambassador />
                </Grid>
                <Grid item xs={1} sm={1}/>
            </Grid>
            <Grid item>
                <br/><br/><br/>
            </Grid>
            <Grid item>
                <Footer/>
            </Grid>
        </Grid>
    )
}

export default Team
